import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
    const navigate = useNavigate();

    const handleExplore = () => {
        navigate('/dashboard'); // or any other route you define
    };

    return (
        <div className="home-container">
            <header className="home-header">
                <h1 className="brand-title">Swadeshi Airlines</h1>
                <p className="tagline">Fly with Pride. Travel with Trust.</p>
                <button className="explore-btn" onClick={handleExplore}>
                    Explore Flights
                </button>
            </header>

            <section className="features">
                <div className="feature-card">
                    <h2>Low-Cost Fares</h2>
                    <p>Experience affordable travel without compromising on comfort and safety.</p>
                </div>
                <div className="feature-card">
                    <h2>Widespread Routes</h2>
                    <p>Connect with major cities and rural destinations across India.</p>
                </div>
                <div className="feature-card">
                    <h2>Indian Hospitality</h2>
                    <p>Feel at home in the skies with our warm and welcoming crew.</p>
                </div>
            </section>

            <footer className="home-footer">
                <p>&copy; 2025 Swadeshi Airlines. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default Home;
